import React, { Component } from 'react';
import { View, Text } from 'react-native';

export default class AddProduct extends Component {
    render() {
        return (
            <View style={{ flex: 1, backgroundColor: '#FFF' }}>
                <Text></Text>
            </View>
        )
    }
}
